  state={todos:[
    {id:1,name:'吃饭',done:true},
    {id:2,name:'睡觉',done:true},
    {id:3,name:'写代码',done:false},
    {id:'4',name:'逛街',done:true}
  ]

  }
  render() {

    const {todos}=this.state
   return( <div className="todo-container">
    <div className="todo-wrap">
         <Header/>
         <List todos={todos}/>
         <Footer/>
    </div>
            </div>
   )
  }




}

export default App;
